import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container } from "react-bootstrap";
import Myheader from "./mycomponent/Myheader";
import Presentation from "./mycomponent/Presentation";
import "./Costumcolor.scss";
import BarraScorrevole from "./mycomponent/BarraScorrevole";
import MyAccordin from "./mycomponent/MyAccordin";
import MyProjects from "./mycomponent/MyProjects";

function App() {
  return (
    <>
      <div className="App"></div>
      <Myheader />
      <Container bg="light">
        <Presentation />
        <BarraScorrevole />
        <MyAccordin></MyAccordin>
        <MyProjects></MyProjects>
      </Container>
    </>
  );
}

export default App;
